import React from 'react';
import attachmentservice from '../services/AttachmentServices';
import {Navbar, Button} from 'react-bootstrap';



class AttachmentComponents extends React.Component{


    constructor(props){
        super(props)
        this.state ={
            attachments:[]
        }

    }
        componentDidMount(){
                attachmentservice.getAttachment().then((Response)=>{
                    this.setState({attachments:Response.data})
                });
    }
    render(){
        return(
            <div>
                <Navbar bg ="black" variant="dark">
                    <Button variant="outline-info">Search</Button>
                    </Navbar>
                <h1 className = "text-center"> My Project</h1>
                <table className = "table table-stripped">
                    <thead>
                        <tr>
                            <th>Barrel</th>
                            <th>Scope</th>
                            <th>Magazine</th>
                            <th>Grip</th>
                        </tr>
                    </thead>

                    <tbody>
                        {
                            this.state.attachments.map(
                                attachment =>
                                    <tr key={attachment.id}>
                                        <td>{attachment.id}</td>
                                        <td>{attachment.barrel}</td>
                                        <td>{attachment.scope}</td>
                                        <td>{attachment.grip}</td>
                                        <td>{attachment.magazine}</td>
                                    </tr>
                            )
                        }
                    </tbody>
                  

                </table>      
            </div>

        )
    }
}
export default AttachmentComponents
